import React, { Component } from "react";
import "./Work.css";

class Work extends Component {
    render(){
        return (
            <div className="Work">
                <iframe src="https://player.vimeo.com/video/23660736" width="640" height="360" frameborder="0" allow="autoplay; fullscreen" allowfullscreen></iframe>
            </div>
        )
    }
}

export default Work;
